<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <title>ezDigital Dashboard</title>
    <style>
      .main_details {
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        height: 90vh;
        width: 100%;
        gap: 10px;
        text-align: center;
      }
      .main_details h1 {
        font-size: 80px;
        font-weight: 600;
        color: rgb(71, 71, 71);
        margin: 0;
      }
      .main_details h2 {
        font-size: 30px;
        font-weight: 600;
        color: rgb(71, 71, 71);
      }
      .main_details p {
        width: 680px;
        margin: 0;
      }
      .main_details a {
        color: #1585c2;
        text-decoration: none;
        font-weight: 600;
      }
      .site-footer {
        margin: auto;
      }
      .site-footer .site-footer__copy {
        text-align: center;
      }
      @media screen and (max-width: 300px) {
        .main_details p {
          width: 90%;
        }
      }
